import 'bootstrap/dist/css/bootstrap.min.css';
import Footer from './Footer';
import Header from './Header';
import About from './Land/About';
import Home from './Land/Home';

function App() {

  return (
    <div className="App">
      <Header />
      <div className="content">
        <Home />
        <About />
      </div>

    </div>
  );

}

export default App;
